import React, { Component } from 'react';
import { Link } from 'react-scroll';
import '../css/Navbar.css';

class Navbar extends Component {

    render() {
        return(
            <div className="navbar">
                <Link 
                    activeClass="active"
                    to="main"
                    spy={true}
                    smooth={true}
                    offset={0}
                    duration={500}
                >Main</Link>
                <Link 
                    activeClass="active"
                    to="projects"
                    spy={true}
                    smooth={true}
                    offset={0}
                    duration={500}
                >Projects</Link>
                <Link 
                    activeClass="active"
                    to="about"
                    spy={true}
                    smooth={true}
                    offset={0}
                    duration={500}
                >About</Link>
                <Link 
                    activeClass="active"
                    to="contact"
                    spy={true}
                    smooth={true}
                    offset={0}
                    duration={500}
                >Contact</Link>
            </div>
        );
    }

}

export default Navbar;
